import React from "react";

export default function Managers({ managers = [] }) {
  return (
    <div>
      <h2>Managers</h2>
      {managers.length === 0 ? (
        <p>No managers available</p>
      ) : (
        <ul>
          {managers.map((mgr, index) => (
            <li key={index}>
              {mgr.name} - {mgr.department}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
